INSERT INTO challenge (id, name, description, created_date, modified_date, created_by, modified_by, object_status, self_help_guide_description, self_help_guide_question, show_in_student_intake, show_in_self_help_search, tags, confidentiality_level_id) VALUES ('07b5c3ac-3bdf-4d12-b65d-94cb55167998', 'Child or Adult Care', 'Child or Adult Care', '2012-03-20 00:00:00', '2013-08-30 12:54:54.068', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 'Child or adult care demands often pose challenges for success in college.  It is important to develop a plan to address these challenges before they become barriers to your academic success.', 'Could my child or adult care cause me to be absent from class or fail to complete assignments?', true, true, 'child, baby, sitter, adult, senior care, daycare, childcare, parent care, home care, elder care, 4C, Childcare Works, Agency on Aging, Head Start, Job and Family Services, babysitter, parenting', NULL);
