INSERT INTO challenge (id, name, description, created_date, modified_date, created_by, modified_by, object_status, self_help_guide_description, self_help_guide_question, show_in_student_intake, show_in_self_help_search, tags, confidentiality_level_id) VALUES ('7c0e5b76-9933-484a-b265-58cb280305a5', 'Finances - Education', 'A majority of college students need assistance paying for their classes and books.  Having a plan to pay your college expenses while maintaining a low student loan commitment will free you to focus on you coursework.', '2012-03-20 00:00:00', '2013-08-30 13:06:21.189', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 'A majority of college students need assistance paying for their classes and books.  Having a plan to pay your college expenses while maintaining a low student loan commitment will free you to focus on you coursework.', 'Am I unfamiliar with all of the different types of aid that the college offers that could address college expenses?', true, true, 'Getting Financial Aid, refund check, pay for books, accepting FA, Accepting Financial Aid, extra cash, paying for school, grants, Pell, FAFSA, FA, Scholarship, Tuition payment Financial Aid Steps, student loans, workshops, cash, loans, FACTS', NULL);
