INSERT INTO challenge_referral (id, name, description, created_date, modified_date, created_by, modified_by, object_status, public_description, show_in_self_help_guide, show_in_student_intake, link) VALUES ('bed66095-78f5-46e5-b277-2ca5ee7adb2d', 'Tutorial Services and Labs', 'Attend tutorial labs or help rooms as suggested by the instructor (listed below). Tutorial Services located in the Library or call 555-2792 Disability Services 10421 or call 555-5113 Academic Math Lab 1315 or call 555-2286 Writing Center - Library 7L or call 555-5106 Math Help Room - Library 7L Tutoring and Learning Center - Library 7L or call 555-2792', '2012-03-20 00:00:00', '2013-09-03 12:02:28.029', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 'Attend tutorial labs or help rooms as suggested by the instructor (listed below). '' Tutorial Services located in the Library or call 555-2792 '' Disability Services 10421 or call 555-5113 '' Academic Math Lab 1315 or call 555-2286 '' Writing Center - Library 7L or call 555-5106 '' Math Help Room - Library 7L '' Tutoring and Learning Center - Library 7L or call 555-2792', true, NULL, '');
