INSERT INTO message_template (id, name, description, subject, body, created_date, modified_date, created_by, modified_by, object_status) VALUES ('aec07252-1ff0-479d-a2ef-c0e017e1c05d', 'Action Plan Step Email', 'Action Plan Step Email', 'An Action Item is Due for Review', '${task.person.firstName},<br/>An Action Item identified through the Community College Resources application needs your attention.  Please login to your account at www.studentsuccessplan.org to review and complete the assigned item.<br/><br/>The following item is due for review:<br/>Challenge: ${task.challenge.name}<br/>Referral: ${task.challengeReferral.name}<br/>Due Date: ${dueDateFormatted}', '2012-05-17 10:00:00', '2012-05-17 10:00:00', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1);
