INSERT INTO message_template (id, name, description, subject, body, created_date, modified_date, created_by, modified_by, object_status) VALUES ('9d3ce5b1-e27d-40c8-8f45-abcb1bccf3b0', 'New Student Intake Task Email', 'New Student Intake Task Email', 'Student Intake Form Request', '<html><body><p>Hello ${fullName}!</p><p>Your Coach or Advisor has asked that you complete a Task online, the Student Intake form.  ${description}  The form is a series of questions that should only take a few minutes to complete.  The information collected will assist us in providing you with the best services and advice that we can.</p> <p>Please login with your college username and password at the following URL:  <a href="https://www.studentsuccessplan.org">https://www.studentsuccessplan.org</a></p><p>The Student Intake link will appear in the Task list on the right side of the screen.</p><p>Please complete this task by ${dueDateFormatted}</p><p>Thank you for your time and cooperation.  We look forward to providing you great service!</p><p>-College Team</p><p>If you have questions, please contact your Coach or Advisor directly. This is an automated message, please do not use the reply option.</p></body></html>', '2012-05-17 10:00:00', '2012-05-17 10:00:00', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1);
