INSERT INTO self_help_guide (id, name, description, created_date, modified_date, created_by, modified_by, object_status, threshold, introductory_text, summary_text, summary_text_early_alert, summary_text_threshold, authentication_required) VALUES ('4fd534df-e7fe-e555-7c71-0042593b1990', 'Student Success Course', 'SCC 101 - Student success course self help guide.', '2012-04-23 00:00:00', '2012-04-23 00:00:00', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 8, 'Welcome to the MyGPS guide for SCC 101.  This course, aided by MyGPS, will help you navigate your pathway to sucess at College.  On the following screens, you will be asked a series of questions concerning typical roadblocks faced by many students.  After submiting your answers, resources will be presented as possible solutions.  You will then have an oportunity to select resources that create your Personal Road Map.', 'Thank you for using MyGPS!  Hopefully you found this guide and your Personal Road Map helpful and informative.  If you have questions about this guide, the resources, your map, or have other counseling or advising questions, please contact your SCC 101 instructor.', 'Due to your answers for the self help guide we have sent an early alert on your behalf to the counseling and advising staff.  They will be contacting you to discuss various options to deal with the challenges you are facing.', 'Due to your answers for the self help guide we have sent an early alert on your behalf to the counseling and advising staff.  They will be contacting you to discuss various options to deal with the challenges you are facing.', true);
INSERT INTO self_help_guide (id, name, description, created_date, modified_date, created_by, modified_by, object_status, threshold, introductory_text, summary_text, summary_text_early_alert, summary_text_threshold, authentication_required) VALUES ('6dce9c28-e7fe-e555-762e-f82ea0c75580', 'Navigating Academic Success', 'Navigating Academic Success - The Next Step', '2012-04-23 00:00:00', '2012-04-23 00:00:00', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 7, 'Welcome to the Navigating Academic Success self-help guide.  Aided by MyGPS, you will navigate your pathway to success at College.  On the following screens, you will be asked a series of questions concerning typical roadblocks faced by many students.  After submitting your answers, resources will be presented as possible solutions.  You will then have an opportunity to select resources that create your Personal Road Map.', 'Thank you for using MyGPS!  Hopefully you found this guide and your Personal Road Map helpful and informative.  If you have questions about this guide, the resources, your map, or any other topics discussed, please contact your advisor or counselor.', 'Due to your answers for the self help guide we have sent an early alert on your behalf to the counseling and advising staff.  They will be contacting you to discuss various options to deal with the challenges you are facing.', 'Due to your answers for the self help guide we have sent an early alert on your behalf to the counseling and advising staff.  They will be contacting you to discuss various options to deal with the challenges you are facing.', false);
INSERT INTO self_help_guide (id, name, description, created_date, modified_date, created_by, modified_by, object_status, threshold, introductory_text, summary_text, summary_text_early_alert, summary_text_threshold, authentication_required) VALUES ('5b7bdb2a-e7fe-e555-7599-02c9e3cacfa5', 'A Quick-Start Guide to College', 'A guide for new students immediately after Application.', '2012-04-23 00:00:00', '2013-09-03 12:40:23.914', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 0, 'Welcome to the Quick Start to College self-help guide.  Aided by MyGPS, you will navigate your pathway to a successful start at College.  On the following screens, you will be asked a series of questions concerning typical roadblocks faced by many students.  After submitting your answers, resources will be presented as possible solutions.  You will then have an opportunity to select resources that create your Personal Road Map.', 'Thanks for completing the Quick Start Guide! ', '', '', false);
INSERT INTO self_help_guide (id, name, description, created_date, modified_date, created_by, modified_by, object_status, threshold, introductory_text, summary_text, summary_text_early_alert, summary_text_threshold, authentication_required) VALUES ('894073e7-e7fe-e555-7c05-ff79555478e7', 'Resources for Academic Intervention', 'A guide for students on academic intervention.', '2012-04-23 00:00:00', '2013-09-03 12:42:14.09', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 0, 'Welcome to Academic Intervention self-help guide. Aided by MyGPS, you will navigate your pathway to success at College.  On the following screens, you will be asked a series of questions concerning typical roadblocks faced by many students. After submitting your answers, resources will be presented as possible solutions. You will then have an opportunity to select resources that create your Personal Road Map.  After completion please mail to: www.studentsuccessplan.org', 'Thanks for completing the Academic Intervention self-help guide!', '', '', false);
INSERT INTO self_help_guide (id, name, description, created_date, modified_date, created_by, modified_by, object_status, threshold, introductory_text, summary_text, summary_text_early_alert, summary_text_threshold, authentication_required) VALUES ('3a6352c9-e7fe-e555-7f69-0124a5e5fe71', 'Traveling Your Career Path', 'A listing of resources for making the most out of your future career.', '2012-04-23 00:00:00', '2013-09-03 12:43:38.92', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', '58ba5ee3-734e-4ae9-b9c5-943774b4de41', 1, 0, 'Welcome to the Traveling Your Career Path self-help guide.  Aided by MyGPS, you will navigate your pathway to a successful career.  On the following screens, you will be asked a series of questions concerning career issues faced by many students.  After submitting your answers, resources will be presented as possible solutions.  You will then have an opportunity to select resources that create your Personal Career Road Map.', 'Thank you for completing the Traveling Your Career Path self-help guide!', '', '', false);
