/*
 * *** SSP TRAINING IMMUTABLE STARTUP CONTENT ***
 *
 * This SQL File contains a data dump from a Postgres SSP database
 *  that contained high-quality demo reference and content data.
 *
 * To upload this file into a blank/default database, you can use
 *  the command line.
 *
 *    psql -U postgres -d ssp -f /pathToThisFile/sspTrainingImmutableStartupContent.sql
 *
 * This script works best on blank databases, however a typical workflow is to
 *  do an initportal or initdb for ssp-platform and then startup tomcat which
 *  runs the liquibase. In that case, this script can also be run and has been
 *  tested that way. You will however see a few duplicate errors but they do 
 *  not affect the operation of this script.
 *
 * Once complete to check and see if the data is in your ssp database,
 *  you can run the query SELECT * FROM elective; It should return
 *  results.
 *
 * Warning: This has not been tested with the masterChangelog-demo and the qa data.
 *     It most likely will work (albeit with more errors), but it has not been tested at all.
 *
 * Note: Requires Postgres 8.4 or higher
 *
 */

