<p>Dear $earlyAlert.person.firstName $earlyAlert.person.lastName</p>

<p>Your instructor for #if( $earlyAlert.courseName )$earlyAlert.courseName#else<COURSE NAME UNAVAILABLE>#end notified me that you are experiencing issues that might affect your success#if( $institutionName ) at $institutionName#end.  An academic advisor, counselor or coach will contact you soon to discuss your situation. In the meantime, here are a few resources which may help you find academic success.</p>

<table><tr><th>Instructor</th><td>$earlyAlert.createdBy.firstName $earlyAlert.createdBy.lastName#if( $earlyAlert.createdBy.workPhone )</td><tr>
<tr><th>Phone</th><td>$earlyAlert.createdBy.workPhone#end</td><tr>
<tr><th>Email</th><td>$earlyAlert.createdBy.primaryEmailAddress</td><tr>
</table>

<p>The Tutoring and Learning Center (Library: 555-4506) provides professional tutoring in the subject areas of English grammar and writing, basic math and study skills. The Center also provides additional quiet computer areas for students, online resources, and supplemental learning materials. Walk-ins are available during open hours. Call for schedule.</p>

<p>Tutorial Services (Library: 555-2792) provides free educational assistance for students who are enrolled in most 100 level courses (including DEV and some 200 level classes). Student tutors provide individual tutoring sessions by appointment.</p>

<p>The Writing Center (Library: 555-5106) provides a comfortable learning environment for classroom instruction and tutorial assistance for writing.</p>

<p>The Math Lab (Building 1, Room 315: 555-2286) provides tutoring and homework help for students in MAT classes. Walk-ins are available during open hours.</p>

<p>COPE is a unique series of workshops designed to help students Conquer some of the Obstacles that can Prevent the achievement of their Educational goals. A schedule of topics is available in 10-424 or online at http://www.studentsuccessplan.org Contact Anthony at 555-2752 for handouts of past or future workshops.</p>

<p>Information on Dropping: Before withdrawing from any or all classes, consult an academic advisor. If you are using financial aid to pay for your tuition or books, contact the Financial Aid & Scholarships Office: Building 10, 3rd Floor, 555 555-3000.</p>

<p>We value you as a student #if( $institutionName ) at $institutionName#end and want to support your success. If you have not been contacted by someone within a week, please feel free to speak with me.</p>

<p>Sincerely,</p>

<p>$earlyAlert.person.coach.firstName $earlyAlert.person.coach.lastName
<br />$earlyAlert.person.coach.title#if( $earlyAlert.person.coach.staffDetails.officeLocation )
<br />$earlyAlert.person.coach.officeLocation#end#if( $earlyAlert.person.coach.workPhone )
<br />$earlyAlert.person.coach.workPhone#end
<br />$earlyAlert.person.coach.primaryEmailAddress</p>

<p>Email generated by $!institutionName $!applicationTitle $!termToRepresentEarlyAlert</p>

<p>This is a system generated email. Please do not reply to this confirmation.</p>
